import React from 'react'

export const Form = () => {
  const fields = ['text', 'radio', 'checkbox'];

  return (
    <div>
        <Form class="row">
      {
        fields.map((key, index) => {
          if(key === 'text') {
              <div class="mb-3">
                <label>Text</label>
                <input type="text" class="form-control" />
              </div>
          } else if(key === 'radio') {
              <div class="mb-3">
                <label>Text</label>
                <input type="text" class="form-control" />
              </div>
          }
        })
      }
      </Form>
    </div>
  )
}
